{
  "title": "Charming 2-Room Apartment in Hliny on Fifth Avenue",
  "description": "Experience modern living in this beautifully renovated 58 m² apartment located on the 3rd floor of an insulated building in Hliny. The apartment features a reconstructed core with a shower enclosure and separate toilet, a fully updated electrical system, and easy-to-maintain tile floors in the hallway and kitchen. Insulation has been added both inside and outside for optimal temperature conditions. A riser pipe replacement ensures smooth plumbing. The apartment boasts plenty of natural light and is conveniently located near amenities, schools, and shops. Don't miss out on this fantastic opportunity!",
